an other than to create. But when he put the tracks side-by-side in a playlist he recognised a synergy, and the outline of the project began to take shape. The result is more of a continuous soundscape than an album; an ethereal and dreamy experience designed to accompany the listener as they turn inward and drift away. If club music is a form of escape, then this is too – but instead of turning outward, we lose ourselves inward.logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1231,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1231,logseq____&quot;^Flogseq____&quot;,1230,536870951]],[logseq____&quot;^15logseq____&quot;,[1231,logseq____&quot;^Xlogseq____&quot;,284,536870951]],[logseq____&quot;^15logseq____&quot;,[1231,logseq____&quot;^Vlogseq____&quot;,284,536870951]],[logseq____&quot;^15logseq____&quot;,[1231,logseq____&quot;^Ulogseq____&quot;,284,536870951]],[logseq____&quot;^15logseq____&quot;,[1231,logseq____&quot;^Ulogseq____&quot;,1228,536870951]],[logseq____&quot;^15logseq____&quot;,[1231,logseq____&quot;^Hlogseq____&quot;,1228,536870951]],[logseq____&quot;^15logseq____&quot;,[1231,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u670b9943-48a4-46ce-9f5a-e07a444aa033logseq____&quot;,536870951]],[logseq____&quot;^15logseq____&quot;,[1232,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;The first single is ‘Silhouette’. It’s a melancholy, atmospheric track with hints of ’80s nostalgia and smooth as glass vocals from Sansa. The track conjures up images of vast and endless landscapes; the sense of space enhanced by sparse chord-changes and field recordings of heavy rain. ‘Silhouette’ is so human it feels like an extension of an emotion, and Yotto says the idea came to him like a dream. A sound drifted towards him one day and he caught it by the tail and built on top of it until it became the entity he envisioned. ’It’s slow and steady and it grows. I think the beauty       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
